int int_to_str (unsigned int number, char *str)
{
  unsigned int value_tmp[10 + 1];
  unsigned int index = 0;
  
  while ((number >= 10) && (index < 10))
  {
    value_tmp[index++] = number % 10;
    number /= 10;
  }
  
  if (number < 10)
  {
    value_tmp[index] = number;
    for ( unsigned int i = 0; i <= index; i++) str[i] = value_tmp[index - i] + 0x30;
    str[index + 1] = '\0';
    
    return true;
  }
  else
  {
    return false;
  }
  
}
